import React from 'react'

const Navbar = () => {

    const links = [
        {
            id: 1,
            link: 'home'
        },
        {
            id: 2,
            link: 'movies/shows'
        },
        {
            id: 3,
            link: 'subscription'
        },
        {
            id: 4,
            link: 'profile'
        },
    ]
    return (
        <>
            <nav className='bg-cyan-500'>
               <ul>
                    {
                        links.map(({ id, link }) => {
                            return (
                            <>
                            <li key={id} className='text-black text-4xl'>
                                {links.link}
                            </li>
                            </>)
                        })
                    }
                </ul>
            </nav>
        </>
    );

}

export default Navbar
